import React from 'react'
import {
    FaDribbbleSquare,
    FaFacebookSquare,
    FaGithhubSquare,
    FaInstagram,
    FaTwitterSquare

} from 'react-icons/fa'

const Footer = () => {
  return (
    <div className='max-w-[1240px] mx-auto py-16 px-4 grid lg:grid-cols-3 gap-8 text-gray-300'>
        <div>
            <h1 className='w-full text-3xl font-bold text-[#00]'></h1>
        </div>
    
    </div>
  )
}

export default Footer
